const styles = {
  container: {
      flex: 1,
      alignItems: 'center',
      justifyContent: 'center',
      borderBottomWidth: '1',
      borderBottomColor: '#eee'
  },
  title: {
      fontSize: 18,
      margin: 10,
      textAlign: 'center',
      color: 'rgb(34, 65, 115)',
},
   logo: {
  width: 305,
  height: 159,
  resizeMode: "contain",
  marginBottom: 30,
  marginTop: 0,
},
  elevatorList: {
      fontSize: 15,
      margin: 10,
      textAlign: 'center',
      color: 'rgb(34, 65, 115)',
      borderBottomWidth: '1',
      borderBottomColor: '#eee'
  },
  button: {
      marginTop: 20,
      elevation: 8,
      backgroundColor: "#335e82",
      borderRadius: 10,
      paddingVertical: 10,
      paddingHorizontal: 12
  },
  buttonText: {
      fontSize: 15,
      color: "#fff",
      fontWeight: "bold",
      alignSelf: "center",
      textTransform: "uppercase"
  }
}
export default login;
